import stack_overflow_icon from "../stack_overflow_icon.png";
import { MdMenu } from "react-icons/md";
import { FaUserCircle } from "react-icons/fa";
import { FaSearch } from "react-icons/fa";
import { Link } from "react-router-dom";
import AskQuestion from "./AskQuestionBar";
import Leftbar from "./Leftbar";
import Navbar from "./Navbar";

export default function Home() {
  return (
    <React.Fragment>
      <div className="w-7/12 h-screen bg-zinc-700">
        <div className="flex items-start justify-between pt-4">
          <p className="mx-2 text-3xl text-white">Top Questions</p>
          <Link
            to={"/askquestion"}
            className="mr-2 h-10 cursor-pointer rounded-sm bg-blue-500 p-2 text-white"
          >
            Ask Question
          </Link>
        </div>

        <div className="relative right-5">
          <button className="p-5">Bounties</button>
          <button className="p-5">Hot</button>
          <button className="p-5">Week</button>
          <button className="p-5">Month</button>
        </div>
      </div>
    </React.Fragment>
  );
}
